description:
Labas, mano vardas Sergej Maslobojev. Taip pat žinomas ringo slapyvardžiu KUVALDA. Esu daugkartinis pasaulio ir Europos kikboksingo čempionas. Turintis misiją savo kanale atskleisti konstruktyvią kovos menų galią ir itaką žmogui. Noriu pasidalinti savo patirtimi, patarimais ir tikslais. 
Čia iš arčiau galėsite pamatyti kaip atrodo kovotojo kelias ir kokia svarbi motyvacija yra kiekvienam iš mūsų. 

Visa tai rasite mano kanale: 
Kovų ir turnyrų apžvalgos;
Kovos vedimo įžvalgos;
Smūgiavimo technikų pamokos:
Profesionalaus atleto kasdienybė;
Lektorystė / Socialinė veikla;
Motyvacija ir darbas su savimi.

Tikiu, kad šiame kanale kiekvienas galėsite rasti sau įkvėpimo ir paskatinimo nerti į kovos menų filosofiją, tuo pačiu kuriant geriausią savo paties versiją. 
Prisimink, kad mes patys rašome savo istoriją..
